import React, {useState} from 'react';
import {Link} from 'react-router-dom';
import {click} from "@testing-library/user-event/dist/click";

function Navbar() {
    const [click, setClick] = useState(false);
    const [button, setButton] = useState(true);

    const handleClick = () => setClick(!click);
    const closeMobileMenu = () => setClick(false);

    const showButton = () => {
        if(window.innerWidth <= 960) {
            setButton(false)
        } else {
            setButton(true);
        }
    };

    window.addEventListener('resize', showButton);

    return (
        <>
            <nav className="navbar">
                <div className="navbar-container">
                    <Link to="/" className="navbar-logo">
                        Christina Qiu <i className="fab fa-typo3" />
                    </Link>
                    <div className="menu-icon" onClick={handleClick}>
                        <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
                    </div>
                    <ul className={click ? 'nav-menu active' : 'nav-menu'}>
                        <li className='nav-item'>
                            <Link to='/' className='nav-links' onClick={closeMobileMenu}>
                                Home
                            </Link>
                        </li>
                        <li className='nav-item'>
                            <Link to='/gamedev' className='nav-links' onClick={closeMobileMenu}>
                                Game Dev
                            </Link>
                        </li>
                        <li className='nav-item'>
                            <Link to='/webdev' className='nav-links' onClick={closeMobileMenu}>
                                Web Dev
                            </Link>
                        </li>
                        <li className='nav-item'>
                            <Link to='/artwork' className='nav-links' onClick={closeMobileMenu}>
                                Artwork
                            </Link>
                        </li>
                        <li className='nav-item'>
                            <Link to='/about' className='nav-links' onClick={closeMobileMenu}>
                                About
                            </Link>
                        </li>
                    </ul>
                    {button && <Button buttonStyle='btn-outline'>SIGN UP</Button>}
                </div>
            </nav>
        </>
    )
}

export default Navbar
